import React from "react";

function List(props) {

return <ul className="list-group">

  {props.groceries.filter((element,index)=>!element.purchased).map(function(element,index){
    return ( 

    <li className="list-group-item" key={element.id}>
    {element.name}
    <button onKeyDown={(e)=>{e.preventDefault()}} onClick={props.onClick} className={props.className}>{props.children}</button>
    </li>
  )}
  )}
    </ul>
}


export default List;
